To decide membership, we run the CYK algorithm on the 11‐token input t6 t5 t24 t0 t16 t15 t15 t6 t6 t10 t14 under the given CNF grammar.  A sketch of the key steps:

1.  Tag each single token with all nonterminals that produce it:
   1:t6 → {NT82, NT9}
   2:t5 → {NT25, NT60}
   3:t24→{NT60, NT98}
   4:t0 → {NT95, NT13}
   5:t16→{NT20}
   6:t15→{NT67, NT25, NT13}
   7:t15→{NT67, NT25, NT13}
   8:t6 →{NT82, NT9}
   9:t6 →{NT82, NT9}
  10:t10→{NT9}
  11:t14→{NT90}

2.  Build up spans of length ­2 … 9.  Crucially, one finds that for the span 1–9 (t6 … t6), we can derive NT37 on 1–4 and NT18 on 5–9, and then use
     NT95 → NT37 NT18
   to get NT95 on 1–9.

3.  Next, on 1–10 we see NT95 on 1–9 and NT9 on position 10, so by
     NT81 → NT95 NT9
   we get NT81 on 1–10.

4.  Finally, NT90 covers the last token t14 (position 11) and
     S → NT81 NT90
   covers 1–11.  

Hence the grammar does generate the string.  

Yes
